import React from 'react'
import s from './QulixSystems.module.css';
import image from '../../../../../../Images/qulix.png'

const QulixSystems = () => {
    return (
        <div className={s.QulixSystems}>
            <img src={image}/>
            <div className={s.GeneralText}>Qulix Systems  – международный поставщик услуг по разработке, тестированию ПО и IT-
            </div>
            <div></div>
            <div></div>
        </div>
    );
}


export default QulixSystems;
